import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Login from './Login';
import Home from './Home';

function App() {
  return (
    <div className="App">
        <h1> Test React </h1>
        <Router>
        <nav>
        <link to="/">Home</link>
        </nav>

              <Route path="/" element={<Home />}/>

        </Router>
        < Login />

    </div>
  );
}

export default App;
